import React from 'react';

const NavBar = () => {
    return (
        <>
            <nav>
                <ul>
                    <li>
                        Singapore got what?
                    </li>
                    <li>
                        Paradox of Choice.
                    </li>
                    <li>
                        You finally decided.
                    </li>
                </ul>
            </nav>
        </>
    );
};

export default NavBar;
